import React from 'react';
import "./Projects.css"
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom";

import {projects} from "../../data/projects.js"

export function Projects() {
  return(
    <div id="content">
      <h2>Projects</h2>
      <nav>
        <ul>
          {LinkList("/projects", projects)}
        </ul>
      </nav>
    </div>
  )
}

function LinkList(root, lis) {
  let elements = [];
  lis.forEach((li, i) => {
    elements.push(
      <li key={i}>
      <Link to={`${root}/${li.name}`}>{li}</Link>
      </li>
    );
  });

  return elements;
}
